import logo from "./logo.svg";
import "./App.css";

function App() {
  const square = (value) => {
    return <button className="square">{value}</button>;
  }

  return (
    <div className="App">
      <div className="row">
        <square value="" />
        <square />
        <square />
      </div>
      <div className="row">
      <square />
        <square />
        <square />
      </div>
      <div className="row">
      <square />
        <square />
        <square />
      </div>
    </div>
  );
}

export default App;
